{time:"61:53",sub:["Temo cosa gli farà quando avrà finito."],index:845},{time:"61:56",sub:["Erik è una brava persona."],index:846},{time:"61:57",sub:["Parla spesso di lei."],index:847},{time:"62:00",sub:["Ha cambiato la sua vita."],index:848},{time:"62:04",sub:["Ha cambiato tutto, qui."],index:849},{time:"62:06",sub:["Stavate meglio prima."],index:850},{time:"62:09",sub:["Noi fingiamo di essere più avanzati..."],index:851},{time:"62:11",sub:["ma veniamo qui combattendo",'come i "Pentapalmi".'],index:852},{time:"62:15",sub:["- Come chi?",'- "Pentapalmi".'],index:853},{time:"62:17",sub:["Sono enormi, squamosi, grosse corna."],index:854},{time:"62:21",sub:["- Non li avete qui?","- Non credo."],index:855},{time:"62:22",sub:["Sono ripugnanti."],index:856},{time:"62:26",sub:["Calpestano tutto quello","che trovano di fronte."],index:857},{time:"62:36",sub:["Quando arrivai sulla Terra..."],index:858},{time:"62:38",sub:["la rabbia di Loki mi rincorse","e voi ne pagaste il prezzo."],index:859},{time:"62:41",sub:["Ora, di nuovo."],index:860},{time:"62:46",sub:["In gioventù, adulavo la guerra."],index:861},{time:"62:50",sub:["La guerra non è cominciata."],index:862},{time:"62:53",sub:["Convincerai Loki","a dirci dove si trova il Tesseract?"],index:863},{time:"62:57",sub:["Non lo so. La mente di Loki è smarrita."],index:864},{time:"63:00",sub:["Non desidera solo il potere,","vuole vendetta su di me."],index:865},{time:"63:05",sub:["La sua brama non sarebbe carpita","neanche dal dolore."],index:866},{time:"63:08",sub:["Molti lo pensano..."],index:867},{time:"63:10",sub:["finché il dolore non comincia."],index:868},{time:"63:14",sub:["Che mi stai chiedendo di fare?"],index:869},{time:"63:16",sub:["Ti chiedo cosa sei disposto a fare..."],index:870},{time:"63:19",sub:["Loki è un prigioniero."],index:871},{time:"63:21",sub:["E perché ho la sensazione che l'unico","che voglia essere..."],index:872},{time:"63:23",sub:["su questa nave sia lui?"],index:873},{time:"63:37",sub:["In pochi possono prendermi alle spalle."],index:874},{time:"63:40",sub:["Ma sapevi che sarei venuta."],index:875},{time:"63:43",sub:["Dopo."],index:876},{time:"63:45",sub:["Dopo le torture che Fury","avesse escogitato..."],index:877},{time:"63:49",sub:["saresti sembrata un'amica, un balsamo."],index:878},{time:"63:53",sub:["E io avrei collaborato."],index:879},{time:"63:55",sub:["Dimmi cosa hai fatto all'Agente Barton."],index:880},{time:"63:58",sub:["Direi che ho ampliato la sua mente."],index:881},{time:"64:02",sub:["E quando avrai vinto..."],index:882},{time:"64:05",sub:["quando sarai il re dei re..."],index:883},{time:"64:08",sub:["che fine farà la sua mente?"],index:884},{time:"64:12",sub:["Questo è amore, Agente Romanoff?"],index:885},{time:"64:14",sub:["L'amore è per i bambini. Sono in debito."],index:886},{time:"64:21",sub:["Racconta."],index:887},{time:"64:27",sub:["Prima di lavorare per lo S.H.I.E.L. D..."],index:888},{time:"64:32",sub:["avevo una certa popolarità."],index:889},{time:"64:36",sub:["Sono dotata di un'abilità specifica."],index:890},{time:"64:40",sub:["Non m'importava per chi la usassi,","o su chi."],index:891},{time:"64:44",sub:["Ero sul radar dello S.H.I.E.L.D.","Con profilo negativo."],index:892},{time:"64:49",sub:["Inviarono Barton ad uccidermi."],index:893},{time:"64:53",sub:["Lui decise diversamente."],index:894},{time:"64:56",sub:["E che farai se promettessi","di risparmiarlo?"],index:895},{time:"65:00",sub:["Non ti farò uscire."],index:896},{time:"65:01",sub:["No, ma mi intriga."],index:897},{time:"65:04",sub:["Il vostro mondo è in bilico,","e tu tratti per un uomo."],index:898},{time:"65:08",sub:["I regimi cadono ogni giorno."],index:899},{time:"65:10",sub:["Non verso lacrime. Sono russa."],index:900},{time:"65:12",sub:["O lo ero."],index:901},{time:"65:15",sub:["E ora cosa sei?"],index:902},{time:"65:17",sub:["Non è così complicato."],index:903},{time:"65:20",sub:["C'è una nota rossa sul mio registro.","Voglio cancellarla."],index:904},{time:"65:25",sub:["Davvero?"],index:905},{time:"65:28",sub:["Puoi cancellare tutto quel rosso?"],index:906},{time:"65:33",sub:["La figlia di Dreykov..."],index:907},{time:"65:36",sub:["San Paolo..."],index:908},{time:"65:39",sub:["l'incendio all'ospedale?"],index:909},{time:"65:42",sub:["Barton mi ha detto tutto."],index:910},{time:"65:45",sub:["Il tuo registro sta grondando.","Il rosso sgorga..."],index:911},{time:"65:48",sub:["e credi che salvare un uomo","non più virtuoso di te..."],index:912},{time:"65:51",sub:["possa cambiare qualcosa?"],index:913},{time:"65:52",sub:["È la più vile forma di sentimentalismo."],index:914},{time:"65:55",sub:["È la preghiera di un bambino."],index:915},{time:"65:57",sub:["Patetico!"],index:916},{time:"65:59",sub:["Tu menti e uccidi..."],index:917},{time:"66:02",sub:["al servizio di bugiardi e assassini."],index:918},{time:"66:08",sub:["Fingi di essere diversa,","di avere un tuo codice..."],index:919},{time:"66:12",sub:["per espiare gli orrori commessi."],index:920},{time:"66:15",sub:["Ma sono parte di te."],index:921},{time:"66:18",sub:["E non ti lasceranno mai più."],index:922},{time:"66:22",sub:["Non toccherò Barton,","non finché non ti avrà ucciso."],index:923},{time:"66:26",sub:["Lentamente, interiormente..."],index:924},{time:"66:28",sub:["con i modi che lui sa che tu temi."],index:925},{time:"66:31",sub:["Poi si sveglierà il tempo necessario","per vedere il suo operato..."],index:926},{time:"66:34",sub:["e quando urlerà, gli fracasserò il cranio."],index:927},{time:"66:38",sub:["È questo il mio patto, vulvetta lamentosa."],index:928},{time:"66:42",sub:["Sei un mostro."],index:929},{time:"66:46",sub:["No."],index:930},{time:"66:49",sub:["Voi avete portato il mostro."],index:931},{time:"66:53",sub:["Allora, Banner."],index:932},{time:"66:56",sub:["È questo il tuo piano."],index:933},{time:"66:57",sub:["Cosa?"],index:934},{time:"66:59",sub:["Loki vuole scatenare Hulk."],index:935},{time:"67:01",sub:["Tenete Banner nel laboratorio. Arrivo."],index:936},{time:"67:02",sub:["E chiamate Thor."],index:937},{time:"67:05",sub:["Grazie..."],index:938},{time:"67:07",sub:["per la tua collaborazione."],index:939},{time:"67:16",sub:["Che fai, Signor Stark?"],index:940},{time:"67:18",sub:["Pensavo la stessa cosa di te."],index:941},{time:"67:21",sub:["Dovreste cercare di localizzare","il Tesseract."],index:942},{time:"67:23",sub:["Infatti. Il modello è fissato,","stiamo cercando la firma gamma."],index:943},{time:"67:26",sub:["Appena rilevata, sapremo dov'è","nel raggio di mezzo miglio."],index:944},{time:"67:29",sub:["E riavrai il tuo Cubo.","Niente agitazione, né confusione."],index:945},{time:"67:31",sub:["E riavrai il tuo Cubo.","Niente agitazione, né confusione."],index:946},{time:"67:33",sub:[`Cos'è la "Fase 2"?`],index:947},{time:"67:37",sub:["Quando lo S.H.I.E.L.D. Usa il Cubo","per fabbricare armi."],index:948},{time:"67:40",sub:["Il computer era troppo lento per me."],index:949},{time:"67:41",sub:["Abbiamo raccolto tutto ciò","che è relativo al Tesseract."],index:950},{time:"67:44",sub:["- Non vuol dire che stiamo fabbricando...","- Scusa, Nick."],index:951},{time:"67:47",sub:["Che cosa mi mentivi?"],index:952},{time:"67:49",sub:["Mi sbagliavo, Direttore.","Il mondo non è cambiato."],index:953},{time:"67:52",sub:["Lei ne sapeva niente?"],index:954},{time:"67:53",sub:["Voleva allontanarsi","da quest'ambiente, Dottore?"],index:955},{time:"67:56",sub:["Ero a Calcutta.","Ero già lontano abbastanza."],index:956},{time:"67:58",sub:["Loki la sta manipolando."],index:957},{time:"68:00",sub:["Invece lei che fa?"],index:958},{time:"68:01",sub:["Non è venuto qui","perché le ho sbattuto le ciglia."],index:959},{time:"68:03",sub:["Resto solo perché","potrebbe irritarsi improvvisamente."],index:960},{time:"68:06",sub:["Ditemi perché lo S.H.I.E.L.D.","Usa il Tesseract..."],index:961},{time:"68:09",sub:["per armi di distruzione di massa."],index:962},{time:"68:12",sub:["Per causa sua."],index:963},{time:"68:14",sub:["Mia?"],index:964},{time:"68:16",sub:["L'anno scorso, un visitatore","da un altro pianeta..."],index:965},{time:"68:19",sub:["ha scatenato uno scontro tra rivali","e distrutto una cittadina."],index:966},{time:"68:22",sub:["Abbiamo imparato,","che oltre a non essere soli..."],index:967},{time:"68:24",sub:["siamo miseramente,","ridicolmente, inadeguati."],index:968},{time:"68:28",sub:["Il mio popolo vuole la pace","con il vostro pianeta."],index:969},{time:"68:30",sub:["Ma voi non siete l'unico popolo."],index:970},{time:"68:33",sub:["Né l'unica minaccia."],index:971},{time:"68:35",sub:["Il mondo si sta riempiendo","di esseri fuori dal comune..."],index:972},{time:"68:38",sub:["che non possiamo controllare."],index:973},{time:"68:40",sub:["Come controllate il Cubo?"],index:974},{time:"68:41",sub:["II vostro lavoro con il Tesseract","ha attirato Loki e i suoi alleati."],index:975},{time:"68:45",sub:["È un segnale per tutti i regni..."],index:976},{time:"68:47",sub:["che la Terra è pronta","per forme di guerra più evolute."],index:977},{time:"68:49",sub:["Più evolute?"],index:978},{time:"68:51",sub:["Ci hai forzato la mano."],index:979},{time:"68:52",sub:["- Dovevamo inventarci qualcosa.","- Un deterrente nucleare."],index:980},{time:"68:54",sub:["Quello calma sempre tutto all'istante."],index:981},{time:"68:56",sub:["Come hai guadagnato la tua fortuna, Stark?"],index:982},{time:"68:59",sub:["Se fabbricasse ancora armi,","Stark sarebbe fino al collo..."],index:983},{time:"69:01",sub:["Sono io, ora, al centro dell'attenzione?"],index:984},{time:"69:03",sub:["Non lo sei sempre?"],index:985},{time:"69:04",sub:["Pensavo che gli umani fossero migliorati."],index:986},{time:"69:06",sub:["Siamo venuti noi, da voi,","a far saltare tutto in aria?"],index:987},{time:"69:09",sub:["Tratti i tuoi campioni con sfiducia."],index:988},{time:"69:11",sub:["Siete così ingenui? Lo S.H.I.E.L.D.","Controlla potenziali minacce."],index:989},{time:"69:15",sub:["Captain America controlla le minacce?"],index:990},{time:"69:16",sub:["Tutti noi."],index:991},{time:"69:18",sub:["E la Vedova Nera?","È più pericolosa dello sciame d'api?"],index:992},{time:"69:21",sub:["Stark, un'altra battutaccia e ti giuro..."],index:993},{time:"69:22",sub:["Minaccia verbale! Mi sento minacciato."],index:994},{time:"69:24",sub:["- Dimostra rispetto.","- Per cosa?"],index:995},{time:"69:34",sub:["Trasporto 6-6 Bravo, confermare codici."],index:996},{time:"69:37",sub:["Vi ho sul monitor,","ma non sul registro giornaliero."],index:997},{time:"69:39",sub:["Il vostro carico? Passo."],index:998},{time:"69:42",sub:["Armi e munizioni. Passo."],index:999},{time:"69:53",sub:["Parli di controllo e cerchi il caos."],index:1e3},{time:"69:55",sub:["È il suo Modus Operandi."],index:1001},{time:"69:57",sub:["Vi credevate una squadra?"],index:1002},{time:"69:58",sub:["No, siamo una mistura chimica","che produce caos."],index:1003},{time:"70:01",sub:["Una bomba ad orologeria."],index:1004},{time:"70:03",sub:["Lei deve allontanarsi."],index:1005},{time:"70:05",sub:["Perché non dovrebbe scaricarsi un po'?"],index:1006},{time:"70:07",sub:["Sai bene il perché. Stammi lontano!"],index:1007},{time:"70:09",sub:["Spero che sia una promessa."],index:1008},{time:"70:12",sub:["Sei grosso con l'armatura."],index:1009},{time:"70:16",sub:["Tolta quella, che cosa sei?"],index:1010},{time:"70:17",sub:["Un genio, miliardario,","playboy, filantropo."],index:1011},{time:"70:20",sub:["Conosco uomini modesti","che valgono 10 volte te."],index:1012},{time:"70:24",sub:["Ho visto i filmati."],index:1013},{time:"70:25",sub:["La sola cosa per cui combatti è te stesso."],index:1014},{time:"70:28",sub:["Non sei il tipo votato al sacrificio..."],index:1015},{time:"70:31",sub:["che si stende sul filo spinato","per far scavalcare gli altri."],index:1016},{time:"70:33",sub:["Io lo taglierei."],index:1017},{time:"70:38",sub:["Sempre una via d'uscita."],index:1018},{time:"70:40",sub:["Non sarai una minaccia..."],index:1019}